"use strict";dotclear.ready((()=>{const e=dotclear.getData("lightbox"),i={loader_img:`${e.url}/img/loader.gif`,prev_img:`${e.url}/img/prev.png`,next_img:`${e.url}/img/next.png`,close_img:`${e.url}/img/close.png`,blank_img:`${e.url}/img/blank.gif`},g=e.extensions.map((e=>`a[href$=".${e}"], a[href$=".${e.toUpperCase()}"]`)).join(", ");$("div.post, article.post").each((function(){$(this).find(g).modalImages(i)}))}));
